import React, { useState, useEffect } from 'react';
import { getAllBluebooksApi } from '../../apis/Api';
import { Link } from 'react-router-dom';
import { ToastContainer, toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';

const Bluebook = () => {
  const [bluebooks, setBluebooks] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetchBluebooks();
  }, []);

  const fetchBluebooks = async () => {
    try {
      const response = await getAllBluebooksApi();
      const approvedBluebooks = response.data.bluebooks.filter(bluebook => bluebook.bluebookStatus === 'APPROVED');
      setBluebooks(approvedBluebooks);
      setLoading(false);
    } catch (error) {
      console.error('Error fetching bluebooks:', error);
      toast.error('Error fetching bluebooks');
    }
  };

  return (
    <div>
      <h2>Bluebook Entries</h2>
      {loading ? (
        <p>Loading...</p>
      ) : bluebooks.length === 0 ? (
        <div>
          <p>No approved bluebook entries found.</p>
          <Link to="/bluebook/create">Create Bluebook</Link>
        </div>
      ) : (
        <div>
          {bluebooks.map(bluebook => (
            <div key={bluebook._id}>
              <h3>{bluebook.bluebookName}</h3>
              <p>Vehicle Number: {bluebook.vehicleNumber}</p>
              <p>Status: {bluebook.bluebookStatus}</p>
              <p>Chassis Number: {bluebook.chassisNumber}</p>
              <p>Engine Number: {bluebook.engineNumber}</p>
              <Link to={`/bluebook/${bluebook._id}`}>View Details</Link>
            </div>
          ))}
          <Link to="/bluebook/create">Create Bluebook</Link>
        </div>
      )}
    </div>
  );
};

export default Bluebook;
